INSERT INTO `news` (`id_news`, `date_news`, `name_news`, `file_news`, `detail_news`) VALUES
(1, '2022-03-26', 'บริษัท โกไฟว์ จํากัด แนะแนวฝึกงาน/สหกิจศึกษาและรับสมัครงาน1', , 'ขอเชิญนิสิตภาควิชาวิศวกรรมคอมพิวเตอร์ชั้นปีที่ 2-4 เข้าร่วมรับฟังการฝึกงาน/สหกิจศึกษาและรับสมัครงาน โดยบริษัท โกไฟว์ จํากัด ในวันอังคารที่ 8 กุมภาพันธ์ 2565 เวลา 13.00 - 15.00 น. แบบออนไลน์ผ่านระบบ Cisco Webex ');
INSERT INTO `news` (`id_news`, `date_news`, `name_news`, `file_news`, `detail_news`) VALUES
(2, '2022-03-23', 'ขอเชิญผู้ที่สนใจเข้าร่วมฟังสัมมนา เรื่อง "AWS Serverless Modernize Web Application" ซึ่งจัดโดยบริษัท ไทย เอ็นเอส โซลูชั่นส์ จำกัด', , 'บริษัท ไทย เอ็นเอส โซลูชั่นส์ จำกัด เป็นบริษัทไอทีชั้นนำสัญชาติญี่ปุ่น ในเครือของนิปปอลสตีล ดำเนินธุรกิจทางด้านการพัฒนาระบบซอฟต์แวร์ในอุตสาหกรรมที่หลากหลาย เช่น ระบบโรงงานการผลิตเหล็ก/ชิ้นส่วนรถยนต์ ระบบการคลัง ระบบการเงิน ระบบการบริหารทรัพยากรบุคคล เป็นต้น ซึ่งจุดประสงค์ของการขอจัดกิจกรรมในครั้งนี้ ทางบริษัทฯ มีความยินดีที่จะแชร์ความรู้ อัพเดทข่าวสารทางด้าน IT ให้กับน้องๆ ทางสาขาวิศวกรรมคอมพิวเตอร์ ทั้งชั้นปีที่ 3 และปีที่ 4 พร้อมกับเปิดรับสมัครงานสำหรับนิสิตจบใหม่หลายอัตรา รวมทั้งมีกิจกรรมเกมให้น้อง ๆ ได้ร่วมสนุก เช่น กิจกรรมเกมตอบคำถามชิงรางวัล ลำโพงบลูทูธ ถุงผ้า หน้ากากผ้า และกิจกรรมสุ่มรายชื่อผู้โชคดีรับรางวัลใหญ่ Ipad Air 4, Apple Watch Series 7, Airpods Gen 3 และ Gift Voucher อื่น ๆ อีกมากมาย');
